import React from "react";
import Card from './Card';
import DataArray from "./DataArray";
const Container =({search})=> <>
    <div className="container">
        {
        DataArray.map((val) => <>
        <Card 
            key = {val.id}
            data = {val}
        />
        </>)
        }
    </div>
</>;

export default Container;
